    const [item, setItems] = useState([])

    const fetchItems = async (e) => {
        const resp = await fetch("http://localhost:3001/buyer/electronic")
        const data = await resp.json()
        console.log(data)
    }

    useEffect(() => {
        fetchItems();
    },[])

    return (
        <React.Fragment>
            <Link to='/buyer'>
                <Button name={'Buyer'}/>
            </Link>
            <Link to='/seller'>
                <Button name={'Seller'}/>
            </Link>

        </React.Fragment>
    )
}

export default Homepage
